// DeleteUniqueIndexCache 删除索引存在的缓存
func (s *SysOperateLogRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.SysOperateLog) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, s.cache.Key(CacheSysOperateLogByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[s.cache.Key(CacheSysOperateLogByIDPrefix, item.ID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysOperateLogByAdminIDPrefix, item.AdminID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysOperateLogByTenantIDPrefix, item.TenantID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysOperateLogByTraceIDPrefix, item.TraceID)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := s.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
